description:
Based on the Armistead Maupin novels of the same name. 3 PBS miniserieses that I have collected here, for fans of this fine show. Themes of homosexuality, counterculture, illicit drug use, and life in San Francisco in the 1970s.

Olympia Dukakis
Donald Moffat
Chloe Webb
Laura Linney
Marcus D'Amico

